import React from 'react';
import propTypes from 'prop-types'



export default function Navbar(props) {

    return (
        <>
           <h1>{props.title}</h1>
           <h2>{props.about}</h2>
        </>
    );
}

Navbar.PropTypes = {
    title : prototype.string,
    about : prototype.string
};

Navbar.default
